import React, { Component }  from 'react';

const GioiThieu = () => {
    return (
        <div className='gioi-thieu'>
            <h1 style={{textAlign : "center"}}>GIỚI THIỆU VỀ DOANH NGHIỆP TƯ NHÂN CƠ KHÍ CƯỜNG THỊNH</h1>
            <div className='content' style={{marginLeft : "100px"}}>
                <p>
                Phụ kiện phòng tắm RIWASU là một sản phẩm của doanh nghiệp tư nhân cơ khí Cường Thịnh
                </p>
                <p>
                    Chúng tôi luôn cam kết đem đến những sản phẩm chất lượng, phù hợp với kinh tế cũng như cầu của nhiều khách hàng
                </p>
            </div>
        </div>
        
    );
    
  };
  
  export default GioiThieu;
